import React from "react";
import { Row, Col, Button } from "antd";
import list from "../assets/list";

const Question = ({ index, handler }) => {
	const q = list[index - 1].q;
	const a1 = list[index - 1].a1;
	const a2 = list[index - 1].a2;

	return (
		<>
			<Row justify="center">
				<Col xs="16" sm="16" md="16" lg="8">
					<h1>{q}</h1>
				</Col>
			</Row>
			<Row gutter={{ xs: 16, sm: 16, md: 16, lg: 8 }} justify="center">
				<Col xs="16" sm="16" md="16" lg="8">
					<Button onClick={handler(1)}>{a1}</Button>
				</Col>
			</Row>
			<Row gutter={{ xs: 16, sm: 16, md: 16, lg: 8 }} justify="center">
				<Col xs="16" sm="16" md="16" lg="8">
					<Button onClick={handler(2)}>{a2}</Button>
				</Col>
			</Row>
		</>
	);
};

export default Question;
